import { Patient } from './../../../shared/models/Patient/patient.model';
import { FbBaseService } from '../../../services/fb-base.service';
import { Component, OnInit } from '@angular/core';
import { Observable, throwError } from 'rxjs';
import { MatDialog } from '@angular/material/dialog';
import { FormControl } from '@angular/forms';
import { catchError, debounceTime, map, startWith } from 'rxjs/operators';
import { ListingAddComponent } from '../add/listing-add.component';

@Component({
  selector: 'app-listing',
  templateUrl: './listing.component.html',
  styleUrls: ['./listing.component.scss']
})
export class ListingComponent implements OnInit {
  list$: Observable<Patient[]> | null = null;

  myControl = new FormControl();

  errorObject = null;

  constructor(private service: FbBaseService<Patient>, private dialog: MatDialog) { }

  ngOnInit(): void {
    this.get();
    this.myControl.valueChanges.subscribe(x => {
      console.log(x);
    })
  }

  get(): void {
    this.errorObject = null;
    this.list$ = this.service.get('patients').pipe(
      catchError(err => {
        this.errorObject = err;
        return throwError(err);
      })
    );
  }

  _filtering(value: string): void {

  }

  openDialog(): void {
    const dialogRef = this.dialog.open(ListingAddComponent, {});
    const infections = this.service.get("infections");
    var amount = 0;
    var infection: any;
    infections.forEach(function (value) {
      amount = value.length;
      infection = value[Math.floor(Math.random() * (amount - 1 + 1))].name;
    });
    // tslint:disable-next-line: deprecation
    dialogRef.afterClosed().subscribe((patient: Patient) => {
      console.log(patient);
      if (patient?.name) {
        patient.infection = infection;
        console.log(infections);
        this.service.add('patients', patient).then(id => { console.log(id); });
      }
    }, err => {
      console.warn(err);
    });
  }

}
<mat-toolbar color="lightgray">
  <mat-toolbar-row>
    <div class="searchbar">
      <input type="text" placeholder="Search..." matInput [formControl]="myControl">
    </div>
  </mat-toolbar-row>
</mat-toolbar>

<app-container classes="container-1 flex">
  <ng-container *ngIf="(list$) | async as list; else loadingOrError">
    <app-listing-card class="item" *ngFor="let item of list" [patient]="item"></app-listing-card>
    <br>
  </ng-container>
  <ng-template #loadingOrError>
    <ng-container *ngIf="errorObject; else loading">
      <span class="centering">
        An error occured!
      </span>
    </ng-container>
    <ng-template #loading>
      <span class="centering">
        <mat-spinner></mat-spinner>
      </span>
    </ng-template>
  </ng-template>
</app-container>

<button mat-fab class="action-btn" color="lightgray" (click)="openDialog()">
  <mat-icon>add</mat-icon>
</button>
